#

Quick start for Android

Contact Sud.Tech to obtain appId, appKey, appSecret for your service.

Download Android SDK SudMGP.aar and the demo project HelloSud-Android.zip.

Import the SDK into the project.
 In the following example, Android Studio 4.2, Gradle 6.7.1, and the SudMgpExample-Android project are used, and the programming language is Java:

Copy SudMGP.aar to the SudMgpExample-Android/app/libs directory, as shown in the following figure:




- Add the configurations required by the SDK to the **SudMgpExample-Android/app/build.gradle** file.

    ```groovy
    repositories {
        // Load the directory of the game SDK libs.
        flatDir {
            dirs '../app/libs'
        }
    }
    dependencies {
        // Load the game SDK AAR package.
        implementation fileTree(include: ['*.jar', "*.aar"], dir: 'libs')
        // Load OkHttp.
        implementation 'com.squareup.okhttp3:okhttp:4.9.2'

        ......
    }
    ```

Initialize the SudMGP. For details, see "HelloSud-Android".

Integrate lifecycle callbacks of the SudMGP and add the game view to the native layout. For details, see "HelloSud-Android".

Load the game using the SudMGP. For details, see "HelloSud-Android".

Optional: Implement ISudFSMMG. For details, see "HelloSud-Android".

Optional: Implement ISudFSTAPP. For details, see "HelloSud-Android".

Deinitialize the SudMGP. For details, see "HelloSud-Android".

