/**
 * Obtain the game Config.
 * The app client needs to call handle.success or handle.fail.
 * @param handle
 * @param dataJson {}
 * Earliest version: V1.1.30.xx.
 */
-(void) onGetGameCfg:(id) handle dataJson:(NSString*)dataJson;

/**
 * Change game state.
 * The app client needs to call handle.success or handle.fail.
 * @param handle
 * @param state
 * @param dataJson
 */
-(void) onGameStateChange:(id) handle state:(NSString*) state dataJson:(NSString*) dataJson;

/**
 * Change game player state.
 * The app client needs to call handle.success or handle.fail.
 * @param handle
 * @param userId
 * @param state
 * @param dataJson
 */
-(void) onPlayerStateChange:(nullable id) handle userId:(NSString*) userId state:(NSString*) state dataJson:(NSString*) dataJson;

@end



